import React from "react";
import Logo from '../Images/logo192.png';
import { Link, NavLink } from "react-router-dom";


const NavBar =() => {
    return(
        
            <header className="text-gray-600 body-font" style={{backgroundColor:"red", width:'100%',height:100,position:'fixed'}}>
  <div class="container mx-auto flex flex-wrap p-5 flex-col md:flex-row items-center" style={{position:'fixed',backgroundColor:"red",width:'100%'}}>
    <a class="flex title-font font-medium items-center text-gray-900 mb-4 md:mb-0">
      {/* <svg xmlns="http://www.w3.org/2000/svg" fill="none" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" class="w-10 h-10 text-white p-2 bg-indigo-500 rounded-full" viewBox="0 0 24 24">
        <path d="M12 2L2 7l10 5 10-5-10-5zM2 17l10 5 10-5M2 12l10 5 10-5"></path>
      </svg> */}
      <img src={Logo} alt="logo" style={{height:50,width:50}}/>
      <span class="ml-3 text-xl">NAVBAR</span>
    </a>
    <nav class="md:ml-auto flex flex-wrap items-center text-base justify-center" >
      <Link to="/" class="mr-5 hover:text-gray-900">Home</Link>
      <Link to="/about" class="mr-5 hover:text-gray-900">About me</Link>
      <Link to="/skills" class="mr-5 hover:text-gray-900">Skills</Link>
      <Link to="/experience" class="mr-5 hover:text-gray-900">Experience</Link>
      <Link to="/contact" class="mr-5 hover:text-gray-900">Contact me</Link>
    </nav>
    
  </div>
</header>
        
    )
}

export default NavBar;
